  false,\n\t\"url\": null,\n\t\"notes\": \"This bedrock geologic map was produced
  by using airborne magnetic and electromagnetic surveys, data and notes from several
  months of fieldwork, geochemical data, and laboratory investigations. These maps
  are the result of new field investigations in the Eagle A-1 Quadrangle by DGGS in
  1999, 2000, and 2001. Field investigations are part of a three-year mapping program
  to provide geologic ground truth for airborne geophysical surveys flown by DGGS
  in the Fortymile mining district during 1998.\",\n\t\"license_title\": null,\n\t\"extras\":
